import React from "react";
import { Card } from "antd";
const { Meta } = Card;

const Category = () => {
  return (
    <div>
      <h2 style={{ margin: 0, padding: 0 }}>Discover Jobs For You</h2>
      <p style={{ margin: 0, padding: 0 }}>Browse Jobs by Category</p>
      <Card
        hoverable
        style={{
          width: 240,
        }}
        cover={
          <img
            alt="example"
            src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png"
          />
        }
      >
        <Meta title="Europe Street beat" description="www.instagram.com" />
      </Card>
      );
    </div>
  );
};

export default Category;
